import React from "react";
import { Link } from "react-router-dom";

function HomeHeading({ heading, postHeading }) {
  return (
    <p className="p1">
    -------
    <Link to="/">{heading}</Link>
    {postHeading && ` - ${postHeading}`}
  </p>
  );
}

export default HomeHeading;
